import logo from './logo.svg';
import './App.css';
import books from './books.json'

function App() {
  console.log(books.books)
  return (
    <div>
      <h1>books</h1>
      {
        books.map((item, i)=>{
          return < Book book={item} key={i}/>
        })
      }
    </div>


  );
}

export default App;
